import React from 'react'
import '../Cards.css';

export default function Personalisasi(){
    return (
        <div class="card" style="max-width: 540px;">
	<div class="row no-gutters">
		<div class="col-md-4">
			<img src="logo_personalisasi.png" class="card-img" alt="..."></img>
		</div>
		<div class="col-md-8">
			<div class="card-body">
				<h5 class="card-title">Tutorial Card Bootstrap 4</h5>
				<p class="card-text">Tutorial cara membuat card vertikal.</p>
				<p class="card-text"><small class="text-muted">Diposting 19 menit lalu</small></p>
			</div>
		</div>
	</div>
</div>
      );
}
